  (30046, 161, 'NEW Exploding Kittens CARD GAME - Original / NSFW / IMPLODING  KITTENS', 'Exploding Kittens is a card game for people who are into kittens and explosions and laser beams and sometimes goats. In this highly-strategic, kitty-powered version of Russian Roulette, players draw cards until someone draws an Exploding Kitten, at which point they explode, they are dead, and they are out of the game -- unless that player has a defuse card, which can defuse the Kitten using things like laser pointers, belly rubs, and catnip sandwiches.', '15.99', 1, 'New', 'ForSale'),
  (30047, 179, 'Speak Out Board Family Party Game Mouthguard Challenge Xmas Adult Toy Gift', 'Get ready to be doubled over with laughter with this ridiculous mouthpiece challenge game! The Speak Out game brings friends and family together for laugh-out-loud fun as players try to say different phrases while wearing a mouthpiece that won''t let them shut their mouth.', '12.99', 2, 'New', 'Wanted'),
