  (30058, 479, 'MONOPOLY THE GAME OF THRONES COLLECTORS EDITION', 'Will you have the gold to afford the crown or will you take what is yours with fire and blood?. In the end, only one can sit atop the Iron Throne, ruling over all others. If you are concerned about your item being left in a specific location we recommend selecting signature.', '52.99', 1, 'New', 'ForSale'),
  (30059, 406, 'Sushi Go Party New Version of Sushi Go Card Game', 'Sushi Go!, is a party platter of mega maki, super sashimi, and endless edamame. What''s more, up to eight players can join in on the sushi-feast. Let the good times roll! Sushi Go Party! gaming warehouse.', '39.50', 1, 'New', 'Wanted'),
  (30060, 6, 'Squatter - Tabletop Board Game BRAND NEW', '• Squatter: a fun board game about Australian sheep farming, for 2 to 6 players. • Much more than fabulous fun, a game of Squatter is highly educational for all ages. • Squatter is a simulation game based on real life farming and is a mix of luck and strategy.', '51.00', 6, 'New', 'ForSale'),
