  (30062, 452, 'Sushi Go! - The Pick and Pass Card Game', 'Pass the sushi! In this fast-playing card game, the goal is to grab the best combination of sushi dishes as they whiz by. Score points for making the most maki rolls or for collecting a full set of sashimi.', '21.98', 1, 'New', 'ForSale'),
