  (30064, 249, 'SCRABBLE GAME Family Board Game Kid Adult Educational Toy Hot Fun Party Fun Game', 'Each player must make the best use of 7 letter tiles drawn at random, taking turns to form words crossword-style across the playing board. Scores are given for letter values and are boosted by premium squares on the grid.', '14.95', 4, 'New', 'ForSale'),
  (30065, 493, 'Settlers of Catan 5th edition Core Set Family Board Game', 'Its name shall be Catan! But you are not the only discoverer. Other fearless seafarers have also landed on the shores of Catan: the race to settle the island has begun! The women and men of your expedition build the first two settlements.', '64.80', 2, 'New', 'Wanted'),
